-- ----------------------------
-- Table structure for sys_log_login
-- ----------------------------
DROP TABLE IF EXISTS `sys_log_login`;
CREATE TABLE `sys_log_login` (
  `serial_no` varchar(32) NOT NULL COMMENT '访问ID',
  `tenant_id` varchar(32) DEFAULT NULL COMMENT '租户id',
  `username` varchar(50) DEFAULT '' COMMENT '用户账号',
  `nickname` varchar(255) DEFAULT NULL COMMENT '用户昵称',
  `ip` varchar(128) DEFAULT NULL COMMENT '登录IP地址',
  `login_location` varchar(255) DEFAULT NULL COMMENT '登录地点',
  `browser` varchar(50) DEFAULT NULL COMMENT '浏览器类型',
  `os` varchar(50) DEFAULT NULL COMMENT '操作系统',
  `status` tinyint(1) DEFAULT '1' COMMENT '登录状态（1成功 0失败）',
  `login_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '访问时间',
  `biz_role_type` tinyint(4) DEFAULT NULL COMMENT '业务角色（1.运营平台 2.租户平台 3.商户 4.店铺 5.客户 99.无）',
  `biz_role_type_no` varchar(32) DEFAULT NULL COMMENT '业务角色id',
  `msg` varchar(500) DEFAULT NULL COMMENT '提示消息',
  `type` tinyint(1) DEFAULT NULL COMMENT '登录类型（1- 登录  2-登出 ）',
  `app_id` varchar(52) DEFAULT NULL COMMENT '应用id',
  `source` varchar(32) DEFAULT NULL COMMENT '来源 ',
  PRIMARY KEY (`serial_no`) USING BTREE,
  KEY `idx_sys_logininfor_s` (`status`) USING BTREE,
  KEY `idx_sys_logininfor_lt` (`login_time`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='系统访问记录';

-- ----------------------------
-- Records of sys_log_login
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for sys_log_oper
-- ----------------------------
DROP TABLE IF EXISTS `sys_log_oper`;
CREATE TABLE `sys_log_oper` (
  `serial_no` varchar(32) NOT NULL COMMENT '日志主键',
  `tenant_id` varchar(32) DEFAULT NULL COMMENT '租户id',
  `method_title` varchar(50) DEFAULT '' COMMENT '方法标题',
  `method` varchar(100) DEFAULT '' COMMENT '方法',
  `request_method` varchar(10) DEFAULT '' COMMENT '请求方式',
  `operator_channel` int(11) DEFAULT '0' COMMENT '操作渠道（0其它 1后台用户 2手机端用户）',
  `oper_by` varchar(50) DEFAULT '' COMMENT '操作人员',
  `request_url` varchar(255) DEFAULT '' COMMENT '请求URL',
  `oper_ip` varchar(128) DEFAULT '' COMMENT '主机地址',
  `oper_location` varchar(255) DEFAULT '' COMMENT '操作地点',
  `input_param` json DEFAULT NULL COMMENT '请求参数',
  `output_param` varchar(2000) DEFAULT '' COMMENT '响应参数',
  `status` int(11) DEFAULT '0' COMMENT '操作状态（0正常 1异常）',
  `error_msg` varchar(2000) DEFAULT '' COMMENT '错误消息',
  `oper_time` datetime DEFAULT NULL COMMENT '操作时间',
  `biz_role_type` tinyint(4) DEFAULT NULL COMMENT '业务角色（1.运营平台 2.租户平台 3.商户 4.店铺 5.客户 99.无）',
  `biz_role_type_no` varchar(32) DEFAULT NULL COMMENT '业务角色id',
  `cost_time` bigint(20) DEFAULT NULL COMMENT '消耗时间（单位：毫秒）',
  `browser` varchar(255) DEFAULT NULL COMMENT '浏览器类型',
  `os` varchar(255) DEFAULT NULL COMMENT '操作系统',
  PRIMARY KEY (`serial_no`) USING BTREE,
  KEY `idx_sys_oper_log_s` (`status`) USING BTREE,
  KEY `idx_sys_oper_log_ot` (`oper_time`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='操作日志记录';

-- ----------------------------
-- Records of sys_log_oper
-- ----------------------------
BEGIN;
COMMIT;

